	(123,43,'wpcf-cau-hoi','Ti c th t mt thit b in pha di my lnh c khng?'),
	(124,43,'wpcf-tra-loi','<strong>Khng nn lm nh vy do:</strong>\r\n<ul>\r\n 	<li>Hi m trong khng kh c th ngng t  dn lnh v nh xung thit b in pha di.</li>\r\n 	<li>Hin tng ngng t c th xy ra  cc im ni ng ti dn ngoi trong qu trnh lm mt.</li>\r\n</ul>'),
	(125,43,'wpcf-ngay-tao',''),
	(132,41,'wpcf-cau-hoi','iu g s xy ra nu ti khng tin hnh bo dng my?'),
	(133,41,'wpcf-tra-loi','Tui th ca my lnh s b rt ngn, li lm mt v rto s b tc v c th xy ra hin tng r nc. Kt qu l lm gim hiu sut hot ng v lm mt ca my lnh.'),
