	(140,42,'wpcf-cau-hoi','Ti c th t l hoa ln trn dn nng c khng?'),
	(141,42,'wpcf-tra-loi','Khng. Khng c t bt c vt g ln trn dn nng v iu ny c th gy kh khn cho nhn vin bo dng hay cng c th gy nguy him cho nhng ngi dn sng xung quanh.'),
	(142,42,'wpcf-hinh-dai-dien','http://demo-wordpress.dev/wp-content/uploads/2017/04/1little-gril-listening-to-music-headphones-12401885.jpg'),
	(143,42,'wpcf-ngay-tao',''),
	(144,44,'wpcf-cau-hoi','Nu phng ca ti b mt tri chiu sng trc tip th c nh hng g n vic la chn my lnh  khng?'),
	(145,44,'wpcf-tra-loi','C. Cng sut lm mt s b nh hng. Tuy nhin, bn c th chn cch lp t mt h thng my lnh c cng sut ln hn cho phng . Hy tham kho  kin nhn vin lp my  chn cng sut lm mt thch hp.\r\n\r\niu g xy ra nu n bo tn hiu lc pht sng? Chc nng ca n ny l g? (Ch p dng cho mt s my c n bo)\r\n\r\niu ny cho bit phin lc kh cn c v sinh. n ny cnh bo  n thi gian v sinh b lc, ty thuc vo mi trng s dng. n c tc dng nhc nh ngi s dng v sinh lc kh. Sau khi v sinh, cn phi thit lp li n bo bng cch nhn nt tn hiu b lc trn iu khin t xa  tt n bo .\r\n\r\n(Su tm)'),
