VALUES
	(1,1,'2017-04-18 04:07:17','2017-04-18 04:07:17','Welcome to WordPress. This is your first post. <em>Edit or delete it</em>, then start writing!\r\n\r\n<img class=\"aligncenter wp-image-17\" src=\"http://demo-wordpress.dev/wp-content/uploads/2017/04/1IMG_21092016_103317-300x169.png\" width=\"1024\" height=\"576\" />','Hello world!','','trash','open','open','','hello-world__trashed','','','2017-04-18 06:57:53','2017-04-18 06:57:53','',0,'http://demo-wordpress.dev/?p=1',0,'post','',1),
	(2,1,'2017-04-18 04:07:17','2017-04-18 04:07:17','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://demo-wordpress.dev/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2017-04-18 04:07:17','2017-04-18 04:07:17','',0,'http://demo-wordpress.dev/?page_id=2',0,'page','',0),
	(3,1,'2017-04-18 04:07:20','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2017-04-18 04:07:20','0000-00-00 00:00:00','',0,'http://demo-wordpress.dev/?p=3',0,'post','',0),
	(4,1,'2017-04-18 04:08:47','0000-00-00 00:00:00','Welcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.','Home','','auto-draft','closed','closed','','','','','2017-04-18 04:08:47','0000-00-00 00:00:00','',0,'http://demo-wordpress.dev/?page_id=4',0,'page','',0),
	(5,1,'2017-04-18 04:08:47','0000-00-00 00:00:00','You might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.','About','','auto-draft','closed','closed','','','','','2017-04-18 04:08:47','0000-00-00 00:00:00','',0,'http://demo-wordpress.dev/?page_id=5',0,'page','',0),
	(6,1,'2017-04-18 04:08:47','0000-00-00 00:00:00','This is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.','Contact','','auto-draft','closed','closed','','','','','2017-04-18 04:08:47','0000-00-00 00:00:00','',0,'http://demo-wordpress.dev/?page_id=6',0,'page','',0),
	(7,1,'2017-04-18 04:08:47','0000-00-00 00:00:00','','Blog','','auto-draft','closed','closed','','','','','2017-04-18 04:08:47','0000-00-00 00:00:00','',0,'http://demo-wordpress.dev/?page_id=7',0,'page','',0),
