	(23,1,'2017-04-18 06:48:49','2017-04-18 06:48:49','<div><em><strong>T quc ti nh mt con tu</strong></em></div>\r\n<em><strong>Mi thuyn ta  Mi C Mau</strong></em>\r\n\r\n- Cu th rt hay ca nh th Xun Diu m nhiu ngi tng c  gi t sinh ng vng t cc Nam ca T quc.\r\n\r\n- Mi C Mau hng v pha ty, thuc a phn xm Mi, x t Mi,huyn Ngc Hin, tnh C Mau, cch thnh ph C Mau hn 100 km. Bn tri Mi gip bin ng di 104 km, bn phi gip bin Ty, tc Vnh Thi Lan di 145 km.\r\n\r\n&gt; Mi C Mau cng l ni duy nht trn t lin Vit Nam c th thy mt tri mc  bin ng v ln  bin Ty.\r\n\r\n- Ngi Vit khi ni v t nc ca mnh thng dng cu Nc Vit Nam tri di t i Nam Quan n Mi C Mau. V vy, trong tm thc ngi Vit, cng vi i Nam Quan, Mi C Mau l mt a im thing ling, xa xi nhng rt i gn gi.\r\n\r\nKnh tha qu khch hng !\r\n\r\n- Bn o C Mau, ni c mt gip bin, ni giao thoa gia hai dng hi lu ng  Ty ng li ph sa ln dn ra bin. \"C Mau, m tr mnh nghe t n\" ni c bi bi rng hng ngn hecta, l ci rn hi sn. C Mau, ni c mng li sng ngi, knh rch chng cht, bt ngn rng c, rng trm vi 3 h sinh thi mn  ngt  l.\r\n\r\n- L ngi Vit Nam, ai chng mun c mt ln xui v t Mi C Mau, ni cht cng bn  hnh ch S  cm nhn ht s k v ca bt ngn rng c, rng trm, s diu k ca ht ph sa ln bin,. c chim ngng, khm ph s a dng sinh hc ca cc h sinh thi rng ngp mn, h sinh thi trn t than bn, h sinh thi bin\r\n\r\n- Chnh s kt hp hi ha gia rng v bin, s an xen gia h sinh thi mn, ngt v l, to cho vng bn o C Mau mt h sinh thi a dng, phong ph, ni c xem l x s ca nhng c sn m kh ni no c c.  l mt ong rng U Minh, Ba Kha Rch Gc, Mm lc U Minh; S huyt Bi Bi; Tm kh Bi Hp, Hu  Bc, kh c khoai Ci i Vm, Cua Bin Nm Cn.','Gii thiu','','publish','closed','closed','','gioi-thieu','','','2017-04-18 06:48:49','2017-04-18 06:48:49','',0,'http://demo-wordpress.dev/?page_id=23',0,'page','',0),
