	(25,1,'2017-04-18 06:49:25','2017-04-18 06:49:25','Knh tha qu khch hng !\r\n\r\n- Hin nay c nhiu ni ly danh ngha bn c Sn C Mau nhng thc ra hng ha m h bn l nhng sn phm nhi thng hiu cc mn c sn ngon ca C Mau.\r\n\r\n- Chng ti l nhng ngi con C Mau, mong mun gii thiu n qu khch hng gn xa nhng mn c sn ngon ca qu hng C Mau. Chng ti lun phn u khng nh s tin tng v Uy Tn &amp; Cht Lng khi qu khch mua sm ti h thng c Sn C Mau ca chng ti.n vi chng ti qu khch hng s hi lng khi c mua sm nhng mn <a href=\"http://www.dacsancamau.com/\">c Sn C Mau</a> chnh hiu.\r\n\r\n- C Mau l vng t tn cng ca t nc  ng gp nhiu mn n ngon cho nn m thc Vit Nam.','Lin H','','publish','closed','closed','','lien-he','','','2017-04-18 06:49:25','2017-04-18 06:49:25','',0,'http://demo-wordpress.dev/?page_id=25',0,'page','',0),
	(26,1,'2017-04-18 06:49:25','2017-04-18 06:49:25','Knh tha qu khch hng !\r\n\r\n- Hin nay c nhiu ni ly danh ngha bn c Sn C Mau nhng thc ra hng ha m h bn l nhng sn phm nhi thng hiu cc mn c sn ngon ca C Mau.\r\n\r\n- Chng ti l nhng ngi con C Mau, mong mun gii thiu n qu khch hng gn xa nhng mn c sn ngon ca qu hng C Mau. Chng ti lun phn u khng nh s tin tng v Uy Tn &amp; Cht Lng khi qu khch mua sm ti h thng c Sn C Mau ca chng ti.n vi chng ti qu khch hng s hi lng khi c mua sm nhng mn <a href=\"http://www.dacsancamau.com/\">c Sn C Mau</a> chnh hiu.\r\n\r\n- C Mau l vng t tn cng ca t nc  ng gp nhiu mn n ngon cho nn m thc Vit Nam.','Lin H','','inherit','closed','closed','','25-revision-v1','','','2017-04-18 06:49:25','2017-04-18 06:49:25','',25,'http://demo-wordpress.dev/index.php/2017/04/18/25-revision-v1/',0,'revision','',0),
	(27,1,'2017-04-18 06:55:01','2017-04-18 06:55:01','<div class=\"cuisine-detail-des\">\r\n<h2>Ni n mn ngon, c sn ca C Mau th phi ni n con cua, cua C Mau ngon, ngt, chc tht ni ting khp nc m nhng con cua ni khc khng th snh bng!</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nC Mau c thin nhin u i vi ba mt tip gip bin cng vi h sinh thi rng ngp mn pht trin nn ngun thy hi sn v cng a dng v phong ph v cng l mi trng l tng, thun li cho con cua pht trin.\r\n\r\nNgy trc, cua bin  C Mau nhiu v s k, nhng hin nay, cua trong thin nhin cn rt t, phn ln cua c nui kt hp trong nhng ao m nui tm. Tuy vy, ngun thc n cho cua vn l t t nhin, cua vn ng nhiu nn tht vn ngt v sn chc.\r\n\r\n</div>','Cua C Mau - c sn ni ting khp nc','','publish','open','open','','cua-ca-mau-dac-san-noi-tieng-khap-nuoc','','','2017-04-18 06:55:01','2017-04-18 06:55:01','',0,'http://demo-wordpress.dev/?p=27',0,'post','',0),
	(28,1,'2017-04-18 06:55:01','2017-04-18 06:55:01','<div class=\"cuisine-detail-des\">\r\n<h2>Ni n mn ngon, c sn ca C Mau th phi ni n con cua, cua C Mau ngon, ngt, chc tht ni ting khp nc m nhng con cua ni khc khng th snh bng!</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nC Mau c thin nhin u i vi ba mt tip gip bin cng vi h sinh thi rng ngp mn pht trin nn ngun thy hi sn v cng a dng v phong ph v cng l mi trng l tng, thun li cho con cua pht trin.\r\n\r\nNgy trc, cua bin  C Mau nhiu v s k, nhng hin nay, cua trong thin nhin cn rt t, phn ln cua c nui kt hp trong nhng ao m nui tm. Tuy vy, ngun thc n cho cua vn l t t nhin, cua vn ng nhiu nn tht vn ngt v sn chc.\r\n\r\n</div>','Cua C Mau - c sn ni ting khp nc','','inherit','closed','closed','','27-revision-v1','','','2017-04-18 06:55:01','2017-04-18 06:55:01','',27,'http://demo-wordpress.dev/index.php/2017/04/18/27-revision-v1/',0,'revision','',0),
	(29,1,'2017-04-18 06:55:47','2017-04-18 06:55:47','<div class=\"cuisine-detail-des\">\r\n<h2>Mm tp, t lu  tr thnh mn n quen thuc v ph bin ca ngi C Mau, nht l vo dp Tt Nguyn n, d giu hay ngho, nh no cng sm mt keo mm tp  n Tt!</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nKhng ging nh nhng loi mm lm t con tm (tp) nh mm tm  Bc, mm ruc  Hu, mm tm ch  G Cng, mm tp C Mu sau khi thnh phm vn gi c hnh dng ca con tp, mu mm  au, nhn rt hp dn, ch mun thng thc ngay.\r\n\r\n c mt keo mm tp thm ngon, ngi C Mau chn nhng con tp t cn ti sng, khng qu ln m cng khng qu nh  lm mm.\r\n\r\nTp t em v ra nc mui cho sch, lt b phn u, rt ch (phn tm)  ro ri ra li bng ru trng, p qua mt t mt ong ri sp vo keo. Tip n nu nc mm ng cho vo keo cng vi mt t ti t xt mng ri em phi nng, phi n khi con tp chuyn qua mu  au, bt mt l c th dng c.\r\n\r\n</div>','Mm tp C Mau -  au tnh nng bin hng rng','','publish','open','open','','mam-tep-ca-mau-do-au-tinh-nang-bien-huong-rung','','','2017-04-18 08:12:56','2017-04-18 08:12:56','',0,'http://demo-wordpress.dev/?p=29',0,'post','',0),
	(30,1,'2017-04-18 06:55:47','2017-04-18 06:55:47','<div class=\"cuisine-detail-des\">\r\n<h2>Mm tp, t lu  tr thnh mn n quen thuc v ph bin ca ngi C Mau, nht l vo dp Tt Nguyn n, d giu hay ngho, nh no cng sm mt keo mm tp  n Tt!</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nKhng ging nh nhng loi mm lm t con tm (tp) nh mm tm  Bc, mm ruc  Hu, mm tm ch  G Cng, mm tp C Mu sau khi thnh phm vn gi c hnh dng ca con tp, mu mm  au, nhn rt hp dn, ch mun thng thc ngay.\r\n\r\n c mt keo mm tp thm ngon, ngi C Mau chn nhng con tp t cn ti sng, khng qu ln m cng khng qu nh  lm mm.\r\n\r\nTp t em v ra nc mui cho sch, lt b phn u, rt ch (phn tm)  ro ri ra li bng ru trng, p qua mt t mt ong ri sp vo keo. Tip n nu nc mm ng cho vo keo cng vi mt t ti t xt mng ri em phi nng, phi n khi con tp chuyn qua mu  au, bt mt l c th dng c.\r\n\r\n</div>','Mm tp C Mau -  au tnh nng bin hng rng','','inherit','closed','closed','','29-revision-v1','','','2017-04-18 06:55:47','2017-04-18 06:55:47','',29,'http://demo-wordpress.dev/index.php/2017/04/18/29-revision-v1/',0,'revision','',0),
	(31,1,'2017-04-18 06:56:24','2017-04-18 06:56:24','<div class=\"cuisine-detail-des\">\r\n<h2>Ngi Nam B c cu: Nht nng, nh chin, tam xo, t luc, mn nng c a ln ng u l bi s a dng phong ph ca n v cng l mn vn gi c cht ngt v hng v nguyn s ca lng thc, thc phm.</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nTrong thc n m thc, ta c th d dng k ra hng chc, thm ch hng trm mn nng. T con g, con c, con tm, con cua n c khoai, tri bp khi nng ln u c mi thm hp dn, kh c th cng li c.\r\n\r\nRing  C Mau, mnh t tn cng ca t quc, c mt mn ngon m cht dn d, gn lin t thi cha ng i khai hoang m ci cho n tn by gi,  l mn c lc nng trui.\r\n\r\n</div>','C lc nng trui - Mn ngon thi khn hoang','','publish','open','open','','ca-loc-nuong-trui-mon-ngon-thoi-khan-hoang','','','2017-04-18 08:44:09','2017-04-18 08:44:09','',0,'http://demo-wordpress.dev/?p=31',0,'post','',0),
	(32,1,'2017-04-18 06:56:24','2017-04-18 06:56:24','<div class=\"cuisine-detail-des\">\r\n<h2>Ngi Nam B c cu: Nht nng, nh chin, tam xo, t luc, mn nng c a ln ng u l bi s a dng phong ph ca n v cng l mn vn gi c cht ngt v hng v nguyn s ca lng thc, thc phm.</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nTrong thc n m thc, ta c th d dng k ra hng chc, thm ch hng trm mn nng. T con g, con c, con tm, con cua n c khoai, tri bp khi nng ln u c mi thm hp dn, kh c th cng li c.\r\n\r\nRing  C Mau, mnh t tn cng ca t quc, c mt mn ngon m cht dn d, gn lin t thi cha ng i khai hoang m ci cho n tn by gi,  l mn c lc nng trui.\r\n\r\n</div>','C lc nng trui - Mn ngon thi khn hoang','','inherit','closed','closed','','31-revision-v1','','','2017-04-18 06:56:24','2017-04-18 06:56:24','',31,'http://demo-wordpress.dev/index.php/2017/04/18/31-revision-v1/',0,'revision','',0),
